import enum, hashlib
from datetime import date, timedelta

class Catalogue():
    def __init__(self, interval):
        self.interval = interval
        self.dataArray = {}

    #def createDateArray(self):

    def addDate(self, newArticle):
        try:
            new_date = self.normDate(newArticle['date'])
            #print(newArticle['date'], "=>", new_date)
            date = new_date.split(" ")
            if self.interval == Interval.Day: dateKey = " ".join(date)
            elif self.interval == Interval.Month: dateKey = " ".join(date[1:])
            elif self.interval == Interval.Year: dateKey = " ".join(date[2:])

            if dateKey in self.dataArray:
                if self.hashArticle(newArticle) not in self.dataArray[dateKey]["articles"]:
                    self.dataArray[dateKey]["count"] += 1
                    self.dataArray[dateKey]["articles"].append(self.hashArticle(newArticle))
            else:
                self.dataArray[dateKey] = {"count": 1, "articles": []}
                self.dataArray[dateKey]["articles"] = [self.hashArticle(newArticle)]
        except Exception as e:
            pass
            #print("Error while parsing. Skipping entry for: ", newArticle)
    def getNumEntries(self):
        return len(self.dataArray)

    def getData(self):
        return self.dataArray

    def hashArticle(self, article):
        article = article['title'].encode('utf-8')
        m = hashlib.sha1(article).hexdigest()
        return m


    def saveData(self):
        months = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"]
        filledDataArray = self.fillDates(self.dataArray)

        headers = "Date, Total \n"
        body = ""
        for date in filledDataArray:
            abvDate = date.split(" ")
            abvDate[0] = months[int(abvDate[0])-1]
            abvDate = " ".join(abvDate)
            dateRecord = abvDate+","+str(filledDataArray[date]["count"])+"\n"
            body += dateRecord
        text = headers+body
        f = open("data.csv", mode="w")
        f.write(text)
        f.close()
        


    def normDate(self, dateParam):
        months = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"]
        dateArr = dateParam.split(" ")

        if "ago" not in dateArr: 
            dateArr[1] = str(months.index(dateArr[1])+1)
            return " ".join(dateArr)

        
        if 48 <= ord(dateArr[0][0]) <= 57: paramDateMod = int(dateArr[0])

        today = date.today()

        if dateArr[1] in  ["min", "mins", "hour", "hours"]: 
            return today.strftime("%d %m %Y")

        elif dateArr[1] == "day":
            dayMod = timedelta(1)
            newDate = today - dayMod
            return newDate.strftime("%d %m %Y")
        elif dateArr[1] == "days":
            dayMod = timedelta(paramDateMod)
            newDate = today - dayMod
            return newDate.strftime("%d %m %Y")
        elif dateArr[1] == "week":
            dayMod = timedelta(7)
            newDate = today - dayMod
            return newDate.strftime("%d %m %Y")
        elif dateArr[1] == "weeks":
            dayMod = timedelta(paramDateMod*7)
            newDate = today - dayMod
            return newDate.strftime("%d %m %Y")
        elif dateArr[1] == "month":
            dayMod = timedelta(30)
            newDate = today - dayMod
            return newDate.strftime("%d %m %Y")
        elif dateArr[1] == "months":
            dayMod = timedelta(paramDateMod*30)
            newDate = today - dayMod
            return newDate.strftime("%d %m %Y")
        else:
            raise ValueError("Date ", dateParam, "Not recognised")


    def fillDates(self, data):
        newDates = []
        for dateItem in data.keys():
            newDates.append([int(dateItem.split(" ")[1]), int(dateItem.split(" ")[0])])
        sortedDates = sorted(newDates)


        firstDate = list(sortedDates[0][::-1])
        lastDate = list(sortedDates[-1][::-1])
        #print("First Date: ", firstDate)
        #print("Last Date: ", lastDate)


        if self.interval == Interval.Month:
            currentDate = list(firstDate)

            while currentDate != lastDate:
                if currentDate[0] == 12:
                    currentDate[1] += 1
                    currentDate[0] = 1
                else: currentDate[0] += 1


                if " ".join(map(str, list(currentDate))) in data.keys(): 
                    continue
                data[" ".join(map(str, list(currentDate)))] = {"count":0}

        return(data)


class Interval(enum.Enum):
    Day = 1
    Month = 2
    Year = 3



